  input: 'TEXT,F3XA,,"In response to an inquiry concerning entries reported on Schedule
    A, Line 15, Offsets to Operating Expenditures, please note the following: 1) The
    offset received from Longley for Congress was payment for mailing expenses in
    excess of the contribution limit; the original disbursements were made to third
    party vendors.  2) The offsets received from David Clarenbach were health insurance
    payments pursuant to federal COBRA laws.  The amount he remits each month is reported
    as a 100% federal expenditure on Schedule B, Line 21b and is not allocated as
    a federal & nonfederal disbursement on Schedule H-4, Line 21a.  3) Because the
    Committee anticipated changing the federal to nonfederal ratio that supports the
    allocation of administrative expenses, but had not yet determined the exact change
    for the election cycle, a transfer from the federal to the nonfederal account
    was not required for amounts reported on Line 15 from Verizon since the federal
    account had exceeded its share of the administrative expenses paid at that time."'
